scriptlet.script:
// This template shows how to access operation return data, inputs and context data 
// and how to set context data, responses and results. 

// To access an input simply refer to the input name from the Inputs panel.  For example: 
noOfTerm = parseInt(termExtnInMonths);
monthValue = parseInt(dateMonthValue);
if(noOfTerm/12>=1)
{
yearToAdd=Math.floor(noOfTerm/12);
}
else
yearToAdd=0;
if(noOfTerm%12>=1)
{
monthToAdd=noOfTerm%12;
}
else
monthToAdd=0;
if((monthValue+monthToAdd)>12)
{
yearToAdd=yearToAdd+1;
monthValue=(monthValue+monthToAdd)-12;
}
else
monthValue=monthValue+monthToAdd;
if(monthValue<10)
{
monthValue='0'+monthValue
}
scriptletContext.put("yearToAdd",yearToAdd);
scriptletContext.put("monthValue",monthValue);
